import PsychologyIcon from '@mui/icons-material/Psychology';

function Logo(){
    return(
        <>
            <div style={{display: 'flex', alignItems: "center" , padding:'20px'}}>
             <PsychologyIcon fontSize="large"/>
            </div>   
        </>  
    )
}

export default Logo;
